import { Component } from '@angular/core';
import { NavController, NavParams, ActionSheetController, Platform, ToastController, LoadingController } from 'ionic-angular';
import { DashboardPage } from '../dashboard/dashboard';
import { AuditionProvider } from '../../providers/audition/audition';
import { GlobalVariablesProvider } from '../../providers/global-variables/global-variables';
import { FileChooser } from '@ionic-native/file-chooser';
import { IOSFilePicker } from '@ionic-native/file-picker';
import { Camera, CameraOptions } from '@ionic-native/camera';
import { FormBuilder, FormGroup, Validators, AbstractControl } from '@angular/forms';
import { FCM } from '@ionic-native/fcm';
import { HttpClient } from '@angular/common/http/';
import { HttpHeaders } from '@angular/common/http';

/**
 * Generated class for the UploadeventPage page.
 *
 * See https://ionicframework.com/docs/components/#navigation for more info on
 * Ionic pages and navigation.
 */

@Component({
    selector: 'page-uploadevent',
    templateUrl: 'uploadevent.html',
})
export class UploadeventPage {
    public min = new Date().toJSON().split('T')[0];;
    imageFile: String = "assets/imgs/newalert.jpg";
    public submitAttempt: boolean = false;
    public isEdit: boolean = false;
    public auditionDate: Date = new Date();
    public imageChanged: boolean = false;
    public max: any;
    public event =
    {
        auditionName: "",
        auditionDate: "",
        auditionUrl: "",
        userId: null,
        auditionDescription: "",
        auditionImage: ""
    };
    public auditionForm: FormGroup;
    public auditionImage: any;
    public userId: any;
    public loader: any;
    public base64Image = "data:image/jpeg;base64,";

    constructor(public http: HttpClient, public navCtrl: NavController, public navParams: NavParams, public globalVariables: GlobalVariablesProvider, public toast: ToastController, public auditionProvider: AuditionProvider, public loadingCtrl: LoadingController, public fileChooser: FileChooser, public platform: Platform, public iosFilePicker: IOSFilePicker, public camera: Camera, public actionSheetCtrl: ActionSheetController, public formBuilder: FormBuilder) {
        this.userId = this.globalVariables.getUserId();
        let date = new Date(new Date().getFullYear() + 10 + '-01-01');
        this.max = new Date(date).toJSON().split('T')[0]
        this.auditionForm = formBuilder.group({
            auditionDescription: [''],
            auditionName: ['', Validators.compose([Validators.required])],
            auditionDate: ['', Validators.compose([Validators.required])],
            auditionUrl: [''],
        });

        if (navParams.data.auditionName != null) {
            this.event = navParams.data;
            this.isEdit = true;
        } else {
            this.isEdit = false;
        }
    }
    ionViewDidLoad() {
        console.log('ionViewDidLoad UploadeventPage');
    }

    openeditprofile() {
        let actionSheet = this.actionSheetCtrl.create({

            buttons: [
                {
                    text: 'Take Photo',
                    role: 'destructive',
                    icon: !this.platform.is('ios') ? 'ios-camera-outline' : null,
                    handler: () => {
                        this.captureImage(false);
                    }
                },
                {
                    text: 'Choose Photo From Gallery',
                    icon: !this.platform.is('ios') ? 'ios-images-outline' : null,
                    handler: () => {
                        this.captureImage(true);
                    }
                }, {
                    text: 'Cancel',
                    role: 'cancel',
                    handler: () => {
                        console.log('Cancel clicked');
                    }
                }
            ]
        });
        actionSheet.present();
    }

    async captureImage(useAlbum: boolean) {
        const options: CameraOptions = {
            quality: 100,
            destinationType: this.camera.DestinationType.DATA_URL,
            encodingType: this.camera.EncodingType.JPEG,
            mediaType: this.camera.MediaType.PICTURE,
            ...useAlbum ? { sourceType: this.camera.PictureSourceType.SAVEDPHOTOALBUM } : {}
        }

        this.camera.getPicture(options).then((imageData) => {
            this.base64Image = 'data:image/jpeg;base64,' + imageData;
            this.imageChanged = false;
            if (this.isEdit)
                this.imageChanged = true;
        }, (err) => {
            this.showError(err);
        });

    }

    showError(str) {
        let toast = this.toast.create({
            message: str,
            duration: 10000,
            position: 'bottom'
        });
        toast.present();
    }

    sendNotification() {
        let body = {
            "notification": {
                "title": "Auditions Alert",
                "body": "An audition has been added.",
                "sound": "default",
                "click_action": "FCM_PLUGIN_ACTIVITY",
                "icon": "fcm_push_icon"
            },
            "data": {
                "param1": "value1",
                "param2": "value2"
            },
            "to": "/topics/auditionsalertsa",
            "priority": "high",
            "restricted_package_name": ""
        }
        let options = new HttpHeaders().set('Content-Type', 'application/json');
        this.http.post("https://fcm.googleapis.com/fcm/send", body, {
            headers: options.set('Authorization', 'key=AAAAyZSpFgc:APA91bF0scbKTY6MDYobDyCSQeuh5qHHveCoE7Ye5lkTWmscBbDd1ihkE63hVfMxElrGvp_MNg8uw6hlWNHpCU0kPlUMk7j4yN2s6ViVYmRtHkSZEE4VSkFMShIXl2FD1umGW34GjHShlGT5UtJBcTv5t2p0vrqDew'),
        }).subscribe(response => {
        }, error => {
        });
    }

    updatePoster() {
        this.submitAttempt = true;
        if (this.auditionForm.valid) {
            this.loader = this.loadingCtrl.create({
                content: "Please wait..."
            });
            this.loader.present();
            if (this.imageChanged) {
                this.auditionProvider.uploadAuditionImage(this.base64Image).subscribe((response: any) => {
                    this.event.auditionImage = response;
                    this.updateEvent();
                });
            } else {
                this.updateEvent();
            }
        }
    }

    updateEvent() {
        this.auditionProvider.updateEvent(this.event).subscribe((response: any) => {
            this.loader.dismiss();
            if (response.result == true) {
                this.showError("Your event has been updated successful.");
                this.navCtrl.setRoot(DashboardPage);
            }
            else {
                this.showError("We are unable to upload your event at the moment please try again later.");
            }
        });
    }

    uploadEvent() {
        this.auditionProvider.uploadEvent(this.event).subscribe((response: any) => {
            this.loader.dismiss();
            if (response.result == true) {
                this.showError("Your event has been shared successful.");
                this.sendNotification();
                this.navCtrl.setRoot(DashboardPage);
            }
            else {
                this.showError("We are unable to upload your event at the moment please try again later.");
            }
        });
    }

    uploadPoster() {
        this.submitAttempt = true;
        if (this.auditionForm.valid) {
            this.loader = this.loadingCtrl.create({
                content: "Please wait..."
            });

            this.loader.present();
            this.auditionProvider.uploadAuditionImage(this.base64Image).subscribe((response: any) => {
                this.event.auditionImage = response;
                this.event.userId = this.userId;
                this.event.auditionDate = this.event.auditionDate + ' ' + new Date().getHours() + ':' + Number(new Date().getMinutes() + 1) + ':' + new Date().getSeconds();
                this.uploadEvent();
            })
        }
    }
}
